//react-function-languege-switch
import React from 'react'

function Labs03() {
    const activeLanguege = {
        display:'block'
    }

    const passiveLanguege = {
        display:'none'
    }

    const languegeSwitch = true;

    return (
        <div>
            <h1>
                <span className="english" style={languegeSwitch ? activeLanguege : passiveLanguege}>Hello, World</span>
                <span className="korean" style={languegeSwitch ? passiveLanguege : activeLanguege}>안녕, 세상아</span>
            </h1>
        </div>
    )
}

export default Labs03
